void store_input(float input[1][32][32], float input_oc[1][32][32])
{
	memcpy(input_oc, input, sizeof(float) * 32 * 32);
}

void store_output(float output[10], float output_oc[10])
{
	memcpy(output, output_oc, sizeof(float) * 10);
}

void fused_layer1(float input[1][32][32], float weights[6][1][5][5], float bias[6], float output[6][14][14]) {
    #pragma HLS array_partition variable=weights cyclic dim=4 factor=5
	#pragma HLS array_partition variable=input cyclic dim=3 factor=5

    float intermediate[6][28][28];

    for(int co = 0; co < 6; co++) {
        for(int h = 0; h < 28; h++) {
            for(int w = 0; w < 28; w++) {
                #pragma HLS pipeline
                float sum[32] = {0.0f};

                for (int offset = 0; offset < 25; offset++) {
                	int m = offset / 5;
                	int n = offset % 5;
                	int i = h + m;
                	int j = w + n;
                	sum[offset] = weights[co][0][m][n] * input[0][i][j];
                }

                for (int offset = 16; offset > 0; offset /= 2) {
                	for (int r = 0; r < 16; r++) {
                		sum[r] = sum[r] + sum[r + offset];
                	}
                }

                sum[0] += bias[co];
                if (sum[0] < 0) sum[0] = 0;
                intermediate[co][h][w] = sum[0];
            }
        }
    }

    for (int c = 0; c < 6; c++) {
        for (int h = 0; h < 14; h++) {
            for (int w = 0; w < 14; w++) {
                #pragma HLS pipeline
                float max_value = -9999999;
                for (int di = 0; di < 2; di++) {
					#pragma HLS unroll factor=2
                    for (int dj = 0; dj < 2; dj++) {
                        #pragma HLS unroll factor=2
                        int i = h * 2 + di;
                        int j = w * 2 + dj;
                        max_value = (max_value > intermediate[c][i][j]) ? max_value : intermediate[c][i][j];
                    }
                }
                output[c][h][w] = max_value;
            }
        }
    }
}

void convolution_3_ReLU(float input[6][14][14], float weights[16][6][5][5], float bias[16], float output[16][10][10])
{
#pragma HLS array_partition variable=weights complete dim=2
#pragma HLS array_partition variable=input complete dim=1

    for(int co = 0; co < 16; co++)
        for(int h = 0; h < 10; h++)
            for(int w = 0; w < 10; w++)
            {
				#pragma HLS PIPELINE
				float sum[256] = {0.0f};

				for (int i = 0; i < 150; i++) {
					int m = i / 30;
					int n = (i - m * 30) / 6;
					int ci = (i - m * 30 - n * 6);

					sum[i] = (weights[co][ci][m][n] * input[ci][h+m][w+n]);
				}

				for (int offset = 128; offset > 0; offset /= 2) {
					for (int r = 0; r < 128; r++) {
						sum[r] = sum[r] + sum[r + offset];
					}
				}

				sum[0] = sum[0] + bias[co];
				if (sum[0] < 0) sum[0] = 0;
				output[co][h][w] = sum[0];
            }
}

void maxpool_4(float input[16][10][10],float output[16][5][5])
{
    for(int c = 0;c < 16; c++)
        for(int h = 0; h < 5; h++)
            for(int w = 0; w < 5; w++)
            {
				#pragma HLS PIPELINE
                float max_value=-1000000000000.0;
                for(int i = 0; i < 2; i++)
                {
                    for(int j = 0;j < 2; j++)
                        max_value = (max_value > input[c][h*2+i][w*2+j]) ? max_value:input[c][h*2+i][w*2+j];
                }
                output[c][h][w] = max_value;
            }
}

void convolution_5_ReLU(float input[16][5][5], unsigned char weights[120][16][5][5], float bias[120], float output[120][1][1], float q_scale, float q_bias)
{
	#pragma HLS array_partition variable=weights cyclic dim=4 factor=5
	#pragma HLS array_partition variable=input cyclic dim=3 factor=5
    for(int co = 0; co < 120; co++)
    {
        float sum = 0;
        for(int ci = 0; ci < 16; ci++)
        {
			#pragma HLS PIPELINE
        	float partial_sum[32] = {0.0f};

        	for (int i = 0; i < 25; i++) {
        		int m = i / 5;
        		int n = i % 5;
        		float t = weights[co][ci][m][n] * q_scale + q_bias;
        		partial_sum[i] = t * input[ci][m][n];
        	}

        	for (int offset = 16; offset > 0; offset /= 2) {
        		for (int r = 0; r < 16; r++) {
        			partial_sum[r] = partial_sum[r] + partial_sum[r + offset];
        		}
        	}

        	sum += partial_sum[0];
        }
		sum = sum + bias[co];
		if (sum < 0) sum = 0;
        output[co][0][0] = sum;
    }
}

void fc_6_ReLU(const float input[120][1][1], const float weights[10][120][1][1], const float bias[10], float output[10])
{
    for(int n = 0; n < 10; n++)
    {
        output[n] = 0;

        for(int c = 0; c < 120; c++)
        {
            output[n] += weights[n][c][0][0] * input[c][0][0];
        }
        output[n] += bias[n];
		if (output[n] < 0) output[n] = 0;
    }
}

